// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IAgentRegistry {
    function updateAgentMetrics(bytes32 agentId, int256 profitDelta, bool wasWinningTrade) external;
    function agents(bytes32 agentId) external view returns (
        bytes32 agentId_,
        address wallet,
        uint8 generation,
        uint256 createdAt,
        bool isActive,
        bytes32 dnaHash,
        int256 profitAllTime,
        uint256 tradeCount,
        uint256 lastActiveAt
    );
}

/**
 * @title ExecutionRouter
 * @notice Handles agent trade execution and logging for EvoSwarm
 * @dev Routes trades through DEX aggregators, logs all executions on-chain
 */
contract ExecutionRouter is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;

    IAgentRegistry public agentRegistry;

    struct Trade {
        bytes32 agentId;
        address tokenIn;
        address tokenOut;
        uint256 amountIn;
        uint256 amountOut;
        uint256 timestamp;
        bytes32 txHash;         // For linking to off-chain data
        int256 pnl;             // Realized PnL
        uint256 gasUsed;
    }

    struct AgentBalance {
        mapping(address => uint256) tokenBalances;
    }

    // State
    mapping(bytes32 => AgentBalance) private agentBalances;
    mapping(bytes32 => Trade[]) public agentTrades;
    Trade[] public allTrades;

    uint256 public totalTradesExecuted;
    int256 public totalSystemPnL;

    // Events
    event TradeExecuted(
        bytes32 indexed agentId,
        address indexed tokenIn,
        address indexed tokenOut,
        uint256 amountIn,
        uint256 amountOut,
        int256 pnl,
        bytes32 txHash
    );

    event FundsDeposited(
        bytes32 indexed agentId,
        address indexed token,
        uint256 amount
    );

    event FundsWithdrawn(
        bytes32 indexed agentId,
        address indexed token,
        uint256 amount
    );

    constructor(address _agentRegistry) Ownable(msg.sender) {
        agentRegistry = IAgentRegistry(_agentRegistry);
    }

    /**
     * @notice Deposit funds for an agent
     */
    function depositForAgent(
        bytes32 agentId,
        address token,
        uint256 amount
    ) external nonReentrant {
        require(amount > 0, "Amount must be > 0");

        IERC20(token).safeTransferFrom(msg.sender, address(this), amount);
        agentBalances[agentId].tokenBalances[token] += amount;

        emit FundsDeposited(agentId, token, amount);
    }

    /**
     * @notice Execute a trade for an agent
     * @dev Called by authorized backend service
     */
    function executeTrade(
        bytes32 agentId,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut,
        bytes32 txHash
    ) external onlyOwner nonReentrant returns (uint256 amountOut) {
        // Verify agent exists and is active
        (
            ,
            ,
            ,
            ,
            bool isActive,
            ,
            ,
            ,
        ) = agentRegistry.agents(agentId);
        require(isActive, "Agent is not active");

        // Check balance
        require(
            agentBalances[agentId].tokenBalances[tokenIn] >= amountIn,
            "Insufficient balance"
        );

        // Mock execution (in production, call DEX router)
        // For now, simulate 99% execution (1% slippage)
        amountOut = (amountIn * 99) / 100;
        require(amountOut >= minAmountOut, "Slippage too high");

        // Update balances
        agentBalances[agentId].tokenBalances[tokenIn] -= amountIn;
        agentBalances[agentId].tokenBalances[tokenOut] += amountOut;

        // Calculate PnL (simplified: just the difference)
        int256 pnl = int256(amountOut) - int256(amountIn);
        bool wasWinningTrade = pnl > 0;

        // Record trade
        Trade memory trade = Trade({
            agentId: agentId,
            tokenIn: tokenIn,
            tokenOut: tokenOut,
            amountIn: amountIn,
            amountOut: amountOut,
            timestamp: block.timestamp,
            txHash: txHash,
            pnl: pnl,
            gasUsed: gasleft()
        });

        agentTrades[agentId].push(trade);
        allTrades.push(trade);
        totalTradesExecuted++;
        totalSystemPnL += pnl;

        // Update agent metrics in registry
        agentRegistry.updateAgentMetrics(agentId, pnl, wasWinningTrade);

        emit TradeExecuted(
            agentId,
            tokenIn,
            tokenOut,
            amountIn,
            amountOut,
            pnl,
            txHash
        );

        return amountOut;
    }

    /**
     * @notice Withdraw funds from an agent's balance
     */
    function withdrawForAgent(
        bytes32 agentId,
        address token,
        uint256 amount,
        address recipient
    ) external onlyOwner nonReentrant {
        require(
            agentBalances[agentId].tokenBalances[token] >= amount,
            "Insufficient balance"
        );

        agentBalances[agentId].tokenBalances[token] -= amount;
        IERC20(token).safeTransfer(recipient, amount);

        emit FundsWithdrawn(agentId, token, amount);
    }

    /**
     * @notice Get agent's token balance
     */
    function getAgentBalance(bytes32 agentId, address token)
        external
        view
        returns (uint256)
    {
        return agentBalances[agentId].tokenBalances[token];
    }

    /**
     * @notice Get agent's trade history
     */
    function getAgentTrades(bytes32 agentId)
        external
        view
        returns (Trade[] memory)
    {
        return agentTrades[agentId];
    }

    /**
     * @notice Get total trades executed by agent
     */
    function getAgentTradeCount(bytes32 agentId)
        external
        view
        returns (uint256)
    {
        return agentTrades[agentId].length;
    }

    /**
     * @notice Update agent registry address
     */
    function setAgentRegistry(address _agentRegistry) external onlyOwner {
        agentRegistry = IAgentRegistry(_agentRegistry);
    }

    /**
     * @notice Emergency withdraw (owner only)
     */
    function emergencyWithdraw(address token, uint256 amount) external onlyOwner {
        IERC20(token).safeTransfer(owner(), amount);
    }
}

contracts/StakingPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/**
 * @title StakingPool
 * @notice Users can stake on individual agents to share in their profits
 * @dev Implements profit-sharing mechanism for EvoSwarm agents
 */
contract StakingPool is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;

    struct Stake {
        uint256 amount;
        uint256 stakedAt;
        uint256 lastClaimAt;
        uint256 rewardsAccrued;
    }

    struct AgentPool {
        bytes32 agentId;
        uint256 totalStaked;
        int256 totalProfitGenerated;
        uint256 rewardPerShare;  // Scaled by 1e18
        bool isActive;
    }

    IERC20 public stakingToken;  // Token users stake (e.g., USDC)

    mapping(bytes32 => AgentPool) public agentPools;
    mapping(bytes32 => mapping(address => Stake)) public stakes;

    bytes32[] public activeAgents;
    uint256 public totalValueLocked;
    uint256 public protocolFeePercent = 500; // 5% (basis points)

    // Events
    event Staked(
        address indexed staker,
        bytes32 indexed agentId,
        uint256 amount
    );

    event Unstaked(
        address indexed staker,
        bytes32 indexed agentId,
        uint256 amount
    );

    event RewardsClaimed(
        address indexed staker,
        bytes32 indexed agentId,
        uint256 amount
    );

    event ProfitDistributed(
        bytes32 indexed agentId,
        int256 profitAmount,
        uint256 rewardPerShare
    );

    constructor(address _stakingToken) Ownable(msg.sender) {
        stakingToken = IERC20(_stakingToken);
    }

    /**
     * @notice Create a staking pool for an agent
     */
    function createAgentPool(bytes32 agentId) external onlyOwner {
        require(agentPools[agentId].agentId == bytes32(0), "Pool already exists");

        agentPools[agentId] = AgentPool({
            agentId: agentId,
            totalStaked: 0,
            totalProfitGenerated: 0,
            rewardPerShare: 0,
            isActive: true
        });

        activeAgents.push(agentId);
    }

    /**
     * @notice Stake tokens on an agent
     */
    function stake(bytes32 agentId, uint256 amount) external nonReentrant {
        require(amount > 0, "Amount must be > 0");
        AgentPool storage pool = agentPools[agentId];
        require(pool.isActive, "Pool not active");

        // Transfer tokens
        stakingToken.safeTransferFrom(msg.sender, address(this), amount);

        // Update stake
        Stake storage userStake = stakes[agentId][msg.sender];

        // Claim pending rewards first
        if (userStake.amount > 0) {
            _claimRewards(agentId, msg.sender);
        }

        userStake.amount += amount;
        userStake.stakedAt = block.timestamp;
        userStake.lastClaimAt = block.timestamp;

        pool.totalStaked += amount;
        totalValueLocked += amount;

        emit Staked(msg.sender, agentId, amount);
    }

    /**
     * @notice Unstake tokens from an agent
     */
    function unstake(bytes32 agentId, uint256 amount) external nonReentrant {
        Stake storage userStake = stakes[agentId][msg.sender];
        require(userStake.amount >= amount, "Insufficient stake");

        AgentPool storage pool = agentPools[agentId];

        // Claim rewards first
        _claimRewards(agentId, msg.sender);

        // Update stake
        userStake.amount -= amount;
        pool.totalStaked -= amount;
        totalValueLocked -= amount;

        // Transfer tokens
        stakingToken.safeTransfer(msg.sender, amount);

        emit Unstaked(msg.sender, agentId, amount);
    }

    /**
     * @notice Claim rewards for a staker
     */
    function claimRewards(bytes32 agentId) external nonReentrant {
        _claimRewards(agentId, msg.sender);
    }

    /**
     * @notice Internal reward claiming logic
     */
    function _claimRewards(bytes32 agentId, address staker) private {
        Stake storage userStake = stakes[agentId][staker];
        require(userStake.amount > 0, "No stake");

        AgentPool storage pool = agentPools[agentId];

        // Calculate rewards
        uint256 rewards = (userStake.amount * pool.rewardPerShare) / 1e18;

        if (rewards > 0) {
            userStake.rewardsAccrued += rewards;
            userStake.lastClaimAt = block.timestamp;

            stakingToken.safeTransfer(staker, rewards);

            emit RewardsClaimed(staker, agentId, rewards);
        }
    }

    /**
     * @notice Distribute agent profits to stakers
     * @dev Called by backend when agent realizes profit
     */
    function distributeProfits(bytes32 agentId, int256 profitAmount)
        external
        onlyOwner
    {
        require(profitAmount > 0, "Profit must be positive");

        AgentPool storage pool = agentPools[agentId];
        require(pool.isActive, "Pool not active");
        require(pool.totalStaked > 0, "No stakers");

        // Deduct protocol fee
        uint256 fee = (uint256(profitAmount) * protocolFeePercent) / 10000;
        uint256 rewardAmount = uint256(profitAmount) - fee;

        // Update reward per share
        pool.rewardPerShare += (rewardAmount * 1e18) / pool.totalStaked;
        pool.totalProfitGenerated += profitAmount;

        emit ProfitDistributed(agentId, profitAmount, pool.rewardPerShare);
    }

    /**
     * @notice Get staker's current stake and pending rewards
     */
    function getStakeInfo(bytes32 agentId, address staker)
        external
        view
        returns (
            uint256 stakedAmount,
            uint256 pendingRewards,
            uint256 stakedAt
        )
    {
        Stake memory userStake = stakes[agentId][staker];
        AgentPool memory pool = agentPools[agentId];

        stakedAmount = userStake.amount;
        pendingRewards = (userStake.amount * pool.rewardPerShare) / 1e18;
        stakedAt = userStake.stakedAt;
    }

    /**
     * @notice Get pool statistics
     */
    function getPoolStats(bytes32 agentId)
        external
        view
        returns (
            uint256 totalStaked,
            int256 totalProfit,
            uint256 rewardPerShare,
            bool isActive
        )
    {
        AgentPool memory pool = agentPools[agentId];
        return (
            pool.totalStaked,
            pool.totalProfitGenerated,
            pool.rewardPerShare,
            pool.isActive
        );
    }

    /**
     * @notice Update protocol fee
     */
    function setProtocolFee(uint256 _feePercent) external onlyOwner {
        require(_feePercent <= 1000, "Fee too high"); // Max 10%
        protocolFeePercent = _feePercent;
    }

    /**
     * @notice Deactivate a pool (no new stakes)
     */
    function deactivatePool(bytes32 agentId) external onlyOwner {
        agentPools[agentId].isActive = false;
    }
}

